/*ReinforcedManagementReport = Lista de Informe Reforzado*/
import React, { useState } from "react"
import PropTypes from 'prop-types';

import {
  Row,
  Col,
  Card,
  CardBody,
  CardHeader,
  Button,
  Label,
  Table
} from "reactstrap"

import { AvForm, AvField } from "availity-reactstrap-validation"

//i18n
import { withTranslation } from "react-i18next"

const Fideicomiso = (props) => {
   

  function handleSubmit(event, errors, values) {
    event.preventDefaulprops.t();
    if (errors.length > 0) {
      return;
    }
    //props.onSubmiprops.t(values);
  }
  
  return (
     
    <React.Fragment>
        
        <Row>
      <Col lg="12">
      <p className="card-title-desc"></p>
        <h4 className="card-title">{ props.t("Escrow") }</h4>
        <p className="card-title-desc"></p>
        
        <AvForm id="frmSearch" className="needs-validation" onSubmit={handleSubmit}>
        <Row>
                <Col md="6">
                  <div className="mb-3">
                    <Label htmlFor="fideicomisoName">{ props.t("Escrowname") }</Label>
                    <AvField
                      className="form-control"
                      name="fideicomisoName"
                      type="text"
                      id="fideicomisoName" value="BASA FID"/>
                  </div>
                </Col>
                <Col md="3">
                  <div className="mb-3">
                    <Label htmlFor="fideicomisoNumber">{ props.t("Escrownumber") }</Label>
                    <AvField
                      className="form-control"
                      name="fideicomisoNumber"
                      type="number"
                      id="fideicomisoNumber" value="20001"/>
                  </div>
                </Col>
              </Row>              

        </AvForm>

      </Col>
    </Row>

   
        </React.Fragment>
    
    
  );

}

export default (withTranslation()(Fideicomiso))
